const names=""
const App=()=>{
    const inputEvent=(event)=>{
        const names=event.target.value;
       // console.log();
    };
    return(
    <>
    <div>
    <h1>Hello{names}</h1>
     <input type="text" placeholder="enter your name" onChange={inputEvent}></input>
     <button>Click me</button>
    </div>
    </>
    )
};
export default App;
